import React from 'react';
import Button from '@mui/material/Button';
import DeleteIcon from '@mui/icons-material/Delete';
import './index.css'

const Note =(props)=>{

    const deleteNote=() =>{
        props.deleteItem();
    }
  return(
      <>
          <div className='note'>
              <h1>{props.title}</h1>
              <br/>
              <p>{props.content}
              </p>
              <Button onClick={deleteNote}>
                    <DeleteIcon/>
              </Button>

          </div>
      </>
  )
}
export default Note
